import React from 'react'
import data from './data'

const Menu = () => {
  return (
    <div>

        <p>Hello World</p>

        {data.map =((onedata) => {
        const {id,name_folder} = onedata
        return <div key={id}>
            <p>{name_folder}</p>
        </div>
    })}</div>
  )
}

export default Menu
